        //                 "minTradeUSDT": null,
        //                 "maxPositionNum": null,
        //                 "maxOrderNum": null
        //             }
        //         ]
        //     }
        //
        object swapUMCBL = this.safeList(response, "data", new List<object>() {});
        ((IDictionary<string,object>)request)["productType"] = "dmcbl";
        response = await this.publicGetApiMixV1MarketContracts(this.extend(request, parameters));
        //
        //     {
