        object timeInForce = this.parseOrderTimeInForce(this.safeStringLower(order, "timeInForce"));
        object postOnly = null;
        if (isTrue(!isEqual(timeInForce, null)))
        {
            postOnly = isEqual(timeInForce, "PO");
